import React, { Component } from 'react';
import {Route, NavLink, Switch} from "react-router-dom";
import Home from './pages/home';

import './App.css';

function App() {
  return (
    <div className="App">
      <header></header>

      <body>
          <Switch>
            <Route exact path="/" component={Home} />
          </Switch>
      </body>
    </div>
  );
}

export default App;
